eration. The application system is available at <a href=\"https://www.russia.study\" rel=\"noopener noreferrer\" target=\"_blank\">www.russia.study</a></p>','text',NULL,92,NULL,'2020-07-28 08:34:34','2020-07-31 11:16:20',NULL),(664,'How to prove the status of a fellow national (compatriot)?',NULL,1,'<p>When applying for entrance trials, you must provide proof that Your ascendants were Soviet citizens (Your passport and birth certificate with translation into Russian language, passport and birth certificate with translation into Russian language of one of relatives born in the USSR). If a parent has changed his/her last name, you also have to submit a document confirming this (for instance, a marriage certificate) with a translation into Russian.</p>','text',NULL,92,NULL,'2020-07-28 08:34:55','2020-07-28 08:34:55',NULL),(665,'If a foreign citizen passed the State Unified Examination (SUE), but is disappointed with its result, can s/he sit the entrance tests at the University?',NULL,2,'<p>Yes, a foreign applicant can submit documents and request entrance tests for one or more subjects, even if s/he passed the SUE in this or those subjects. </p><p><u style=\"color: rgb(230, 0, 0);\">Important!</u> After registering for the entrance tests, the results of the SUE in this/those subject renders it null and void for our University. Therefore, you should take the decision cautiously.</p>','text',NULL,92,NULL,'2020-07-28 08:35:13','2020-07-28 08:37:31',NULL),(666,'Shall a notarized translation of documents be made in Russia or in the country of my origin?',NULL,3,'<p>You can preferably certify translations of documents at the consular Department of the Embassy of the Russian Federation in your country, as well as at a notary in the Russian Federation.</p>','text',NULL,92,NULL,'2020-07-28 08:35:30','2020-07-28 08:35:30',NULL),(667,'If the education document is issued in two languages, one of which is Russian, do I need to translate the foreign language version?',NULL,4,'<p>If the information in the education document is a word for word translation into Russian, then you do not need to translate the document.</p>','text',NULL,92,NULL,'2020-07-28 08:35:48','2020-07-28 08:35:48',NULL),(668,'How can I take examinations online?',NULL,5,'<p>Entrance tests with the use of remote learning technologies are carried out in compliance with «The procedure for conducting entrance tests with the use of remote learning technologies at the Federal state budgetary educational institution of higher education «Ogarev Mordovia State University».</p>','text',NULL,92,NULL,'2020-07-28 08:36:26','2020-07-28 08:36:26',NULL),(669,'How many degree programs can I apply for?',NULL,6,'<p>In accordance with the Admission Rules, the applicant has the right to submit documents to 5 universities for 3 degree programs in each University.</p>','text',NULL,92,NULL,'2020-07-28 08:36:45','2020-07-28 08:36:45',NULL),(670,'Can I stay in a dormitory while I go through the entrance trials?',NULL,7,'<p>Yes, foreign applicants can temporarily stay in dormitories on the University campus. By doing so, you must provide medical certificate (proof of passed medical examination), and apply for an authorisation letter from International relations office when filing for migration registration there.</p>','text',NULL,92,NULL,'2020-07-28 08:37:05','2020-07-28 08:37:05',NULL),(671,'Результаты тестирования 31.07.2020',NULL,7,'<ol><li>   Абдухамидов Баходур Шухратжонович 98</li><li>   Агафонова Яна Александровна 100</li><li>   Айзятова Диана Наильевна 100</li><li>   Андреева Яна Александровна 100</li><li>   Белова Мария Владимировна 100</li><li>   Борискин Игорь Федорович 100</li><li>   Буланкина Ольга Олеговна 100</li><li>   Вахобов Ойбек Комилович 95</li><li>   Видякина Алена Валерьевна 98</li><li>   Видякина Анастасия Сергеевна 93</li><li>   Габечава Виктория Романовна 100</li><li>   Гречишкин Денис Игоревич 100</li><li>   Джабирова Калимат Джабировна 98</li><li>   Дмитриенко Вадим Алексееви